import React from 'react'

export const NotesList = (props) => {
    const { notes = [] } = props
    console.log('notes:' + notes)

    const noteList = [];

    for (let note of notes) {
        noteList.push(<option data-testid={note.id} className="list-group-item">{note.name}</option>);
    }

    return <div className="list-group">
        <option></option>{noteList}
    </div>
}
